INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(1, 'Is this a zombie?', '12', 'Aikawa Ayumu is a normal high school boy. One day he is killed by a serial killer and revived as a zombie by a necromancer named Eucliwood Hellscythe. He starts to serve Eu as her guard but he happens to deprive the masou-shoujo Haruna of her magic power. Haruna orders Ayumu to fight against the anti-masou-shoujo system "Megalo" in her place.', '2011-01-11', , 'www.youtube.com/embed/1o4PAHbqBd4');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(2, 'Is this a zombie? Of the dead', '10', 'Aikawa Ayumu was revived as a zombie by the cute necromancer Eucliwood Hellscythe. After the zany, madcap adventures in the first season of Is This a Zombie? ended, Ayumu thought his life might finally get back to normal, or as normal as it can be for a zombie. However, destiny has other plans for him. Some guys just can''t catch a break. ', '2012-04-05', , 'www.youtube.com/embed/FmVaP4n2jVs');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(3, 'High school of the dead', '12', 'The story follows a group of high school students (and the school''s nurse) as they deal with a worldwide catastrophic event known as the "Outbreak". As the cast tries to survive the zombie apocalypse, they must also face the additional threats of societal collapse, in the form of dangerous fellow survivors, and the possible decay of their own moral codes. Starting from the high school, the students escape into town where they must deal with a corrupt teacher and his students. They check their homes for survivors, and pick up a little girl and a dog. Later, they hold up at a mall, travel through a police station, and eventually make their way to an elementary school that is supposedly a safe zone.', '2010-07-10', , 'www.youtube.com/embed/j_OEW_rJTJU');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(4, 'Guilty Crown', '22', 'The story begins when high school student Shu Ouma encounters a wounded girl named Inori Yuzuriha, the vocalist of a popular internet group Egoist, taking refuge at his film club''s workshop. The GHQ Anti Bodies storm the workshop and arrest her for involvement with the terrorist group Funeral Parlor. Shu follows the coordinates of Inori''s robot to a drop zone where he meets Gai Tsutsugami, leader of Funeral Parlor, who asks him to safeguard a vial. As GHQ begins attacking the Ruppongi area looking for the vial, it shatters as Shu goes to rescue Inori when she becomes threatened by GHQ Endlave mechs. The vial contains the Void Genome, a powerful genetic weapon derived from the Apocalypse Virus that grants Shu the "Power of the Kings", an ability that allows his right hand to extract Voids, weapons of people''s psyche given physical form. Shu then extracts Inori''s Void and destroys the attacking Endlaves.', '2011-10-13', , 'www.youtube.com/embed/fEnQbYB4UEo');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(5, 'Sword Art Online', '25', 'The virtual game world, and the setting of the first story arc. The world takes the form of a giant floating castle called Aincrad, with 100 floors in it. Each floor has a medieval-themed setting and a dungeon with a boss, which has to be defeated before players can advance to the next higher floor. Like most RPGs, it implements a level-based system. However, after the beta testing, the game''s creator activated a system to trap the players inside the game, unable to log out; if players die in-game, or the helmets they used are removed, a strong, electromagnetic pulse is emitted, frying their brain and killing them.', '2012-07-02', , 'www.youtube.com/embed/ueCVDVWY8Ho');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(6, 'Mirai Nikki', '26', 'This psychological thriller, based on the manga written and illustrated by Sakae Esuno, is about Yuki, a loner who''s not very good with people. He prefers to write a diary on his cell phone and talk to his imaginary friend, Deus Ex Machina  The God of Time and Space. However, Yuki soon learns that Deus is more than a figment of his imagination when he makes Yuki participate in a battle royale with eleven others. The contestants are given special diaries that can predict the future, each diary possessing unique features that give it both advantages and disadvantages. Within the next 90 days, the contestants must try to survive until there is only one left standing. The winner will become the new God of Time and Space.', '2011-10-10', , 'www.youtube.com/embed/ql0NtjXIv_s');
INSERT INTO `Anime` (`anime_id`, `anime_name`, `episodes`, `description`, `release_date`, `anime_picture`, `anime_video`) VALUES
(7, 'Strike the blood', '24', 'The Fourth PrimogenitorThat''s the world''s strongest vampire that should only exist in legends. Accompanied by twelve Kenjuu and spreading calamity, this phantom vampire appeared in Japan. For the observation and obliteration of this Fourth Primogenitor, the government and Lion King decided to dispatch an attack mage known as a Sword Shaman. However, for some reason, the one chosen for the observation was a apprentice Sword Shaman girl, Himegari Yukina. Wielding the strongest anti-primogenitor spirit spear, Yukina arrived at Demon District, Itogami City. What is the true identity of the Fourth Primogenitor, Akatsuki Kojou, she encountered over there!?', '2013-10-04', , 'www.youtube.com/embed/_glP0KrnjA4');

